const Pw_Abilities = ({ pw, cover }) => {
  return (
    <section
      className="bg-slate-950 bg-fullcenter flex items-end min-h-[70vh]"
      style={{ backgroundImage: "url(" + cover + ")" }}
    >
      <div className="flex-seperate size-full shadowFromBottom md:px-32 padding">
        {pw.map((item) => {
          return (
            <div key={item.key} className="text-center">
              {item.icon ? (
                <i
                  className={
                    item.icon + " font-bold md:text-4xl sm:text-2xl text-md"
                  }
                />
              ) : (
                <h3 className="font-bold md:text-4xl sm:text-2xl text-md">
                  {item.title}
                </h3>
              )}
              <p className="md:text-sm sm:text-[10px] text-[8px]">{item.key}</p>
            </div>
          );
        })}
      </div>
    </section>
  );
};

export default Pw_Abilities;
